# # Image Processing
# 
# 이미지 프로세싱(영상 처리)은 기존의 픽셀에 특정 연산을 가해 새로운 픽셀 값을 만들어내는 작업이다. 공간영역 필터링과 블러링이 이미지 프로세싱 과정에 속한다.<br>
# *Image Processing is the work to get new pixel value by computing something to existing pixel value. Spacial domain filtering and blurring is included in image processing procedure.* <br><br>
# 공간영역 필터링은 컨볼루션 연산을 통해 이뤄진다. 연산은 커널의 사이즈와 특성을 변경해서 조작할 수 있다.<br>
# *Spacial domain filtering is executed by convolution operation. We can control the operation by changing the size and feature of kernel(window, filter, mask).*
# 

# 
# ![image.png](data:image/png;base64,)

# 블러링은 저화질로 이미지를 흐리게 만드는 작업이다. 평균 블러링 기법이나 가우시안 블러링 기법 등을 이용해서 이미지를 흐리게 할 수 있다. 말그대로, 평균 블러링은 픽셀을 둘러싸고 있는 주변 픽셀들의 평균 값으로 대체하는 기법이다. 가우시안 필터링은 가우시안 분포 커널을 이용해서 이미지를 처리하는 기법이다. 커널의 값은 가운데에서 가장 크고 가운데에서 멀어질 수록 그 값이 작아진다.<br>
# *Blurring is the work blur the image to the lower resolution. We can blur image by using average blurring or Gaussian blurring. Literally, average blurring is the way replace the pixel value to surrounding pixels's average. Gaussian blurring is the way process the image with Gaussian distributed kernel. The value of the kernel is biggest in the middle, and smaller to side.*<br><br>
# 
# 우리는 이번 노트북에서 가우시안 블러링을 사용한다. 커널이 정규 분포로 구성되어 있기 때문에 원본 영상을 최대한 보존하면서 노이즈는 제거할 수 있다.<br>
# *We will use the Gaussian blurring in this notebook. Since the kernel is consist of normal distribution, we can remove the noise while protecting the original image.*<br>
# <br>

# ![image.png](data:image/png;base64,)

# ### Gaussian Blur & Thresholding
# > 모델 학습에서 성능을 높이기 위해 이미지 프로세싱 기법을 적용
# > * 가우시안 블러를 통해 불순물을 제거
# > * 스레시홀딩 기법을 통해 바이너리 이미지로 변환
# >> 바이너리 이미지 : 검은색과 흰색으로만 표현한 이미지]

# ![cnn.png](data:image/png;base64,)

# 좌측 상단부터 시계 방향 순으로 원본, Global thresholding, Adaptive thresholding 1, 2이다.<br>
# Global thresholding은 원본 훼손 정도가 심하므로 Adaptive thresholding을 사용한다.

# In[ ]:


#가우시간 블러 + 스레시홀딩
def threshold_gaussian(data_list):
    thr_gau = []
    for data in tqdm(data_list):
        #tmp = cv2.cvtColor(data[0], cv2.COLOR_BGR2GRAY)
        tmp = cv2.GaussianBlur(data[0], (9,9), 0)

        tmp = cv2.adaptiveThreshold(
            tmp,
            maxValue = 255.0,
            adaptiveMethod = cv2.ADAPTIVE_THRESH_GAUSSIAN_C,
            thresholdType = cv2.THRESH_BINARY_INV,
            blockSize = 19,
            C = 9
        )
        thr_gau.append([tmp, data[1]])
    del tmp
    return np.array(thr_gau)
        
#스레시홀딩만 적용
def threshold(data_list):
    thr_only = []
    for data in tqdm(data_list):
        #tmp = cv2.cvtColor(data[0], cv2.COLOR_BGR2GRAY)
        
        tmp = cv2.adaptiveThreshold(
        data[0],
        maxValue = 255.0,
        adaptiveMethod = cv2.ADAPTIVE_THRESH_GAUSSIAN_C,
        thresholdType = cv2.THRESH_BINARY_INV,
        blockSize = 19,
        C = 9
        )
        thr_only.append([tmp, data[1]])
    del tmp
    return np.array(thr_only)

dataset_t = threshold(dataset)
dataset_tg = threshold_gaussian(dataset)


# > 비교를 위해 스레시홀딩만 적용한 이미지와 가우시안블러와 스레시홀딩을 둘 다 적용한 이미지를 출력

