# # A. CNN Model

# ![deep neural network.png](data:image/png;base64,)

# 2017년 기준,
# * x축: Operations(연산 처리량)
# * y축: Accuracy(연산 정확도)
# * 원의 크기: 메모리의 용량
# 우측 상단으로 갈 수록, 연산 처리량과 연산 정확도가 높은 기술이고 원의 크기가 작을 수록 사용하는 메모리의 용량이 작다.

# ![그림1.png](data:image/png;base64,)

# ## 1. Convolution Neural Network(CNN)
# 입력된 이미지에서 다시 한 번 특징을 추출하기 위해 커널을 도입한 것이 CNN.<br>
# 커널을 이용해서 새롭게 만들어진 층을 컨볼루션이라고 한다. 이 컨볼루션을 통해서 입력 데이터의 특징을 더 잘 추출할 수 있다.<br>
# 
# 
# **Conv2D()**
# * 첫 번째 인자: 커널의 개수. 여러가지의 커널을 만들 경우 컨볼루션도 여러가지 만들어진다.
# * kernel_size: 커널의 크기. kernel_size=(행,열)
# * input_shape: 맨 처음 층에는 입력되는 값을 알려주어야 한다. input_shape=(행,열,색상(3) 또는 흑백(1))
# * activation: 활성화 함수
# 
# ## 2. Pooling(풀링)
# 컨볼루션 층을 통해서 이미지의 특징이 잘 보이도록 가공을 마친 후, 풀링(pooling) 과정을 거쳐서 이미지의 크기를 조정한다. 이 과정을 서브 샘플링(sub sampling)이라고도 한다.<br>
# 맥스 풀링(max pooling)은 정해진 구역 안에서 최댓값을 뽑아내고 평균 풀링(average pooling)은 평균값을 뽑아낸다. 맥스 풀링이 보편적으로 사용된다.<br>
# 
# **MaxPooling2D()**
# * pool_size: 풀링의 크기. pool_size=2 이면 전체 사이즈가 1/2이 된다. 디폴트가 2다.
# 
# ## 3. Flatten(플래튼)
# 컨볼루션과 맥스 풀링 과정을 거친 모델을 Dense 층에 연결하려면 Flatten 과정을 거쳐야 한다. 왜냐하면 컨볼루션과 맥스 풀링을 할 때 이미지 데이터는 2차원 배열이지만, 활성화 함수가 있는 층에서는 1차원 이미지 데이터만 사용할 수 있기 때문이다. 따라서 Flatten() 함수로 2차원 배열을 1차원 배열로 바꾼다.<br>
# **Flatten()**
# 
# 
# ## 4. drop out(드롭아웃)
# 노드와 층이 너무 많아지면 과적합이 발생할 수 있기 때문에 drop out(드롭아웃)을 통해 은닉층 노드 일부를 임의로 끈다.<br>
# **Dropout()**
# * 25% 노드를 제외하려면 Dropout(0.25)라고 적는다.
# 

# In[ ]:


### 합성곱 신경망 구성
model = Sequential()
model.add(Conv2D(32,3,padding="same", activation="relu", input_shape = X.shape[1:]))
# 32개의 3x3 사이즈 커널을 이용하여 컨볼루션을 만든다. 맨 처음으로 입력되는 값은 (120,120,1), 즉 120x120 사이즈의 흑백 이미지이다. 활성화 함수는 relu를 이용한다.
model.add(MaxPool2D())
# 컨볼루션을 끝낸 이미지의 사이즈를 반으로 줄인다. (2가 디폴트 )

model.add(Conv2D(64, 3, padding="same", activation="relu"))
# 64개의 3x3 사이즈 커널을 이용하여 컨볼루션을 만든다. 활성화 함수는 relu를 이용한다.
model.add(MaxPool2D())
# 컨볼루션을 끝낸 이미지의 사이즈를 반으로 줄인다.

model.add(Conv2D(128, 3, padding="same", activation="relu"))
# 128개의 3x3 사이즈 커널을 이용하여 컨볼루션을 만든다. 활성화 함수는 relu를 이용한다.
model.add(MaxPool2D())
# 컨볼루션을 끝낸 이미지의 사이즈를 반으로 줄인다.

### Dense 층
model.add(Flatten())
# 2차원 배열을 1차원 배열로 만든다.
model.add(Dense(256,activation="relu"))
# Dense 층에 연결
model.add(Dropout(0.5))
# 노드의 50%를 제외
model.add(BatchNormalization())
model.add(Dense(1, activation="sigmoid"))

### 신경망에 대한 정보를 출력
model.summary()


# In[ ]:


opt = tf.keras.optimizers.Adam(learning_rate=1e-5)

model.compile(loss="binary_crossentropy", optimizer=opt, metrics=["accuracy"])

Dir = './model/'
if not os.path.exists(Dir):
  os.mkdir(Dir)
modelpath = "./model/{epoch:02d} - {val_loss:.4f}.hdf5"

checkpointer = ModelCheckpoint(filepath = modelpath, monital = 'val_loss', verbose = 1, save_best_only= True)

early = EarlyStopping(monitor = 'val_loss', patience = 4)

history = model.fit(X_train, y_train, epochs = 15, batch_size = 128, verbose=1, callbacks = [early, checkpointer], validation_data = (X_test, y_test))

print('\nAccuracy : {:.4f}'.format(model.evaluate(X_test, y_test)[1]))


# # Model Accuracy
# 단순 CNN 모델의 경우, 0.9927%의 정확도 보임

# In[ ]:


y_vloss = history.history['val_loss']
y_loss = history.history['loss']

x_len = np.arange(len(y_loss))
plt.plot(x_len, y_vloss, c = 'red', markersize = 3,label = 'Testset_loss')
plt.plot(x_len, y_loss, c = 'blue', markersize = 3,label = 'Trainset_loss')
plt.legend(loc = 'upper right')
plt.grid()
plt.xlabel('epoch')
plt.ylabel('loss')
plt.show()


y_vacc = history.history['val_accuracy']
y_acc = history.history['accuracy']

x_len = np.arange(len(y_acc))
plt.plot(x_len, y_vacc, c = 'red', markersize = 3,label = 'Testset_accuracy')
plt.plot(x_len, y_acc, c = 'blue', markersize = 3,label = 'Trainset_accuracy')
plt.legend(loc = 'lower right')
plt.grid()
plt.xlabel('epoch')
plt.ylabel('accuracy')
plt.show()

